import React from 'react';
import { View, Image, Text } from 'react-native';


import styles from './styles';

function TeacherItem() {
    return(
        <View style={styles.container} >
            <View style={styles.profile} >
                <Image
                    style={styles.avatar}
                    source={{ uri: 'https://avatars2.githubusercontent.com/u/39069727?s=460&u=621d8848b41457266f7a8199f335702e9985b17d&v=4'}}
                />

                <View style={styles.profileInfo}>
                    <Text style={styles.name}>Murilo Gois</Text>
                    <Text style={styles.subject}>História</Text>
                </View>
            </View>
            <Text style={styles.bio}>

                Moacyr Scliar foi um importante escritor brasileiro, nascido em Porto Alegre em 1937, formou-se em medicina em 1963  e seguiu carreira profissional. Em 1962 publica seu primeiro livro a partir daí sua carreira não parou mais, foram mais de 70 títulos publicados e chegou a ser membro da Acadêmia Brasileira de Letras. 
                Morreu no dia 27 de fevereiro, aos 73, por falência múltipla dos orgãos.
            </Text>

            <View style={styles.footer}>
                <Text style={styles.price}>
                    Preço/Hora
                </Text>
            </View>

        </View>

    );
}

export default TeacherItem;
